import React, { Component } from 'react'

class HomeComponent extends Component {
    render() {
        const {status} = this.props
        let show = 'Error'
        if(status){
            show = 'Welcome'
        }
        return (
            <div>
                <h1>{this.show}</h1>
            </div>
        )
    }
}

export default HomeComponent
